  \"2013-03-14T19:25:54.866274\",\n\t\"name\": \"waterfowl-cholera-ds107\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This is a data set of the location and
  number of waterfowl carcasses observed during aerial surveys of the Sacramento-San
  Joaquin Delta by survey tract. It is comprised of a shapefile containing location
  information and a separate data table (the extended file) containing information
  from the actual observations. This metadata file contains the metadata for both
  the shapefile data table and the extended table. Surveys were made from November
  through March, from 1993 through 2000. There are 2494 observation records. The aerial
  surveys were made of 59 designated areas in the Sacramento-San Joaquin River Delta
  in Sacramento, San Joaquin, Alameda, and Yolo counties. The original spatial data
  were provided in an Arc 3.x shapefile. The waterfowl population and carcass count
  in the extended table was provided in a .dbf. Each record provide the name and size
  of the parcel where the waterfowl were found, the number of dead waterfowl seen,
  an index of the total number of waterfowl in the polygon being surveyed, the date
  of the survey, the number and species of the dead waterfowl picked up, and the date
  of the carcass collection.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
